import Sequelize, { Model } from 'rn-sequelize';
import { sequelize } from '../sequelize';

export class $TM_FILENAME_BASE extends Model {}

$TM_FILENAME_BASE.init(
	{
		id: {
			type:Sequelize.UUIDV4,
			allowNull: false,
			defaultValue: Sequelize.UUIDV4,
			primaryKey: true
		},
		created_at: {
			type: Sequelize.STRING,
		},
		updated_at: {
			type: Sequelize.STRING,
			defaultValue: null
		},
		deleted_at: {
			type: Sequelize.STRING,
			defaultValue: null
		},
	},
	{
		sequelize,
		modelName: '$TM_FILENAME_BASE',
		timestamps: false
	}

);
